  useEffect(() => {
    const fetchMeals = async () => {
      fetch('https://react-app-fd13e-default-rtdb.firebaseio.com/meals.json').then();
    };
    fetchMeals();
  }, [])

  return <section className={classes.meals}>
    <Card>
      <ul>{DUMMY_MEALS.map(meal => <MealItem id={meal.id} key={meal.id} name={meal.name} description={meal.description} price={meal.price} />)}</ul>
    </Card>
  </section>
};

export default AvailableMeals;
